import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import MNButton from "../ui/menuBT";
import Template from "../ui/template";
import Userimg from "../ui/Userimg";
import Drop from "../ui/Drop";
import BTemplate from "../ui/BackgroundBox";
import SButton from "../ui/SelectButton";
import './writepage.css';
import Button from "../ui/Button";
import styled from "styled-components";

const Space = styled.div`
  width: 10px;
  height: 0.2px;
  display: inline-block;
`;

const Container = styled.div`
    width: 100%;
    max-width: 720px;

    & > * {
        :not(:last-child) {
            margin-bottom: 16px;
        }
    }
`;

function Writepage(props) {

    const navigate = useNavigate();
    return (
        <Template>
            <Drop/>
            <Userimg
                onClick={() => {
                navigate("/auth/select-page");
            }}/>
            <BTemplate>
                <Space></Space>
                <Container>
                    <Button
                        title="살까 말까"
                        onClick={() => {
                        navigate("/post-write");
                        }}
                    />
                    <Space></Space>
                    <Button
                        title="할까 말까"
                        onClick={() => {
                        navigate("/post-write");
                        }}
                    />
                    <Space></Space>
                    <Button
                        title="갈까 말까"
                        onClick={() => {
                        navigate("/post-write");
                        }}
                    />
                    <span className="flex-container">
                        <div><MNButton title="카테고리" /></div>
                        <div Class="Btn2">
                                <input Type="Radio" Name="category" Id="fashion" checked />
                                <label For="fashion">패션</label>
                        </div>
                        <div Class="Btn2">
                            <input Type="Radio" Name="category" Id="appliance" />
                            <label For="appliance">가전</label>
                        </div>
