                    </span>
                    
                    <span className="addButton">
                        <div>
                            <SButton 
                                title="등록하기" 
                                onClick={() => {
                                    navigate("/main-page");
                                }}
                            />
                        </div>
                    </span>
                </Container>
            </BTemplate>
        </Template>
    );
